      <div className="col-lg-3 w-100">
         <div className="card " key={item.id} >
      <div className="card-img">
        <img src={item?.images[1]} style={{width:"100%"}} />
      </div>
      </div>
         
    </div>
    </div>
    </div>
  )

})}





